import React, { useState, useEffect } from "react";
import { Typography } from "@mui/material";
import { useParams } from "react-router-dom";
import fetchModel from "../../lib/fetchModelData";

function UserPhotos() {
  const { userId } = useParams();
  const [photos, setPhotos] = useState([]); // State to store the list of users

  useEffect(() => {
    const fetchUserPhotos = async () => {
      try {
        const data = await fetchModel(`photo/${userId}`);
        console.log(data);
        setPhotos(data);
      } catch (error) {
        console.error("Error fetching user list:", error);
      }
    };

    fetchUserPhotos();
  }, [userId]);

  // Check if photos is an array before rendering
  if (!Array.isArray(photos)) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <Typography variant="body1">User Photos for User ID: {userId}</Typography>
      <div>
        {photos.map((photo) => (
          <div key={photo._id}>
            {/* <img src={"/images/" + photo.file_name} /> */}
            <Typography variant="body2">Time: {photo.date_time}</Typography>
            <Typography variant="h6">Comments</Typography>
          </div>
        ))}
      </div>
    </div>
  );
}

export default UserPhotos;
